import React, { useState } from 'react';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import firebase from '../infocomponents/firebase';

function FillHistoryComponent() {
	return (
		<div>
			<Card bg="transparent">
				<Card.Header className="slogan-2">
					<h4>Address</h4>
				</Card.Header>
				<Card.Text />
				<Card.Footer className="text-muted">
					<button className="btn btn-outline-dark " onClick={onHandleEditPersonal}>
						<Link className="text-warning" to="/booking">
							Edit Details
						</Link>
					</button>
				</Card.Footer>
			</Card>
		</div>
	);
}

export default FillHistoryComponent;
